import { Component } from "@angular/core";

@Component({
  selector: "app-navbar",
  templateUrl: "./navbar.component.html",
  styleUrls: ["./navbar.component.scss"],
})
export class NavbarComponent {
  check() {
    console.log("click");
  }
}
<nav>
  <a (click)="check()" routerLink="">Home</a>
  <a routerLink="shopping">Shopping</a>
</nav>
